        <script>H5PIntegration = {"ajax":{"setFinished":"","contentUserData":""},"ajaxPath":"/h5p/ajax?action=","contents":{"cid-2560756434":{"displayOptions":{"copy":false,"copyright":true,"embed":false,"export":false,"frame":true,"icon":false},"fullScreen":"1","jsonContent":"{\"iconType\":\"icon\",\"icon\":\"exclamation\",\"color\":\"#ff2900\",\"hotspots\":[{\"position\":{\"x\":70.403125,\"y\":17.51299810442631},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>This is a suspicious, unknown sender.  Also beware long strings of numbers or short 5-6 digit codes.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"b95cd79f-ce1c-49da-8c85-eea9fa5d3e81\"}],\"header\":\"&quot;93859info@hrpsbpay.com&quot;\"},{\"position\":{\"x\":68.403125,\"y\":33.21336587358048},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Just because they're your bank, phone company, etc., doesn't mean they are.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"de2bb721-cbe4-42ea-93a5-859f4da32f55\"}],\"header\":\"&quot;FRM: WellsFargoATM&quot;\"},{\"position\":{\"x\":78.40312499999999,\"y\":36.93806551236069},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>A sense of urgency is created.  Take your time and verify through your actual account, or your bank's public number.  They're counting on us to panic so we act fast and make mistakes.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"dcb46635-52a0-4742-9c43-4a56c6749926\"}],\"header\":\"&quot;$900 Withdrawal Approved&quot;\"},{\"position\":{\"x\":61.203125,\"y\":43.17870506229196},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Scammers trick victims into calling them back.  An unknown phone number like this could probably you to the scammer themself.  Only call a number printed on your bank card or published on an official site.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"29e1d83f-cfc8-4244-a046-d03dc7ba7405\"}],\"header\":\"&quot;Call:833.983.2265&quot;\"},{\"position\":{\"x\":68.403125,\"y\":53.25768878613022},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Scammers are tricky to get us to act fast.  Sometimes a realistic message could be a scammer pretending to be a bank helping you <em>avoid</em> a scam. </p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"690ae443-9695-442b-a8d5-2b59ca920430\"}],\"header\":\"&quot;Contact If Suspicious&quot;\"},{\"position\":{\"x\":75.203125,\"y\":56.55638223592339},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>This string of letters is not an official bank or service provider website. </p>\\n\\n<p>Fake URLs can get a lot tricker than this, using part of an <em>actual company name</em> or a slight misspelling.  Always start with the <strong>official website</strong>.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"f7c2978f-3c38-445b-b9d1-a52602cf066c\"}],\"header\":\"&quot;Link: mnwlkvae.info/akrf&quot;\"}],\"hotspotNumberLabel\":\"Hotspot #num\",\"closeButtonLabel\":\"Close\",\"image\":{\"path\":\"data:image/jpeg;base64,/9j/4AAQSkZJRgABAQAA+gD6AAD/4QCeRXhpZgAATU0AKgAAAAgABQESAAMAAAABAAEAAAEaAAUAAAABAAAASgEbAAUAAAABAAAAUgEoAAMAAAABAAIAAIdpAAQAAAABAAAAWgAAAAAAAAD6AAAAAQAAAPoAAAABAAOShgAHAAAAEgAAAISgAgAEAAAAAQAABFWgAwAEAAAA
